      *
      * key = Base64.decode64("+ZYvJDZMHUfBkJdyq5Zm9SKqeuBQ4sj+6sfjlH4CgG0=")
      * public_key = RbNaCl::PublicKey.new(key)
      *
      * box = RbNaCl::Boxes::Sealed.from_public_key(public_key)
